import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router , Route , Routes } from 'react-router-dom'
import CalendarScreen from './components/Calendar';

function App() {
  return (
   <Router>
    <Routes>
      <Route path='/' element={<CalendarScreen/>} />
    </Routes>
   </Router>
  );
}

export default App;
